import React from "react";
import GoogleMapReact from "google-map-react";

function Map({ center, zoom, locations }) {
  // Define your marker component

  const Marker = ({ lat, lng }) => (

    <div style={{ color: "red", fontSize: "24px" }}>üìç</div>
  );

  return (
    <div style={{ width: "50%", margin: "auto", position: "relative", paddingBottom: "50%", border: "1px solid gray" }}>
      <GoogleMapReact center={center} zoom={zoom}>
        {locations.map(({ lat, lng }, index) => (
          <Marker key={index} lat={lat} lng={lng} />
        ))}
      </GoogleMapReact>
    </div>
  );
}

export default Map;
